import Card from './UI/Card';
import cssClasses from './ListUser.module.css';

const ListUser = props => {
    return(
        <Card className={cssClasses.user}>
            <ul>
                {props.users.forEach(user => { <li>{user[username]}</li> })}
            </ul>
        </Card>
    )
};

export default ListUser;
